import React from 'react';
import {Row, Col, Button ,Collapse, Typography,icon} from 'antd';
import styled from 'styled-components';
const { Panel } = Collapse;
const PanelStyle = styled(Panel)`
 &&&{
    .ant-collapse-header{
        color: white;
    }
    a.ant-typography, .ant-typography a {
        color: white;
    }
    .ant-collapse-content-box{
        padding: 15px 40px;
    }
`;
const TypographyStyle = styled(Typography.Link)`
    display: block;
    padding: 5px 5px;
`;
function RoomList(props) {
    return (
        <Collapse ghost defaultActiveKey={['1']}>
            <PanelStyle header="Danh sách các phòng" key="1">
                <TypographyStyle >Room 1</TypographyStyle>
                <TypographyStyle >Room 2</TypographyStyle>
                <TypographyStyle >Room 3</TypographyStyle>
            </PanelStyle>
            <Button type='text' icon={<icon.PlusSquareOutlined/>} ghost>Thêm phòng</Button>
        </Collapse>
    );
}

export default RoomList;
